import React from "react";
import axios from 'axios';

function AddItem(props) {
    const handleClick = (e) => {
        axios.get('/findAll').then(console.log)
    }

    return ( <
        div >
        <
        button onClick = {
            (e) => handleClick(e)
        }
        type = "button"
        id = "add" > Add to Cart < /button> <
        /div>

    );
};

export default AddItem;
